    {"path": "README.md", "content": "# Node.js TODO API

This is a simple REST API built using Node.js, designed to manage a list of tasks (TODOs). It supports basic CRUD operations and persists data to a file.

## Features
- **CRUD Operations**: Create, Read, Update, Delete todos.
- **Persistence**: Data is saved to a JSON file on disk.
- **REST API**: Supports GET, POST, PATCH, DELETE requests for managing todos.

## Installation
No external dependencies are used. All functionality is built with Node.js builtin modules.

## Usage
1. Clone the repository.
2. Run `npm install` to install necessary packages (none).
3. Start the server using `node src/server.js`.
4. Use a tool like Postman or cURL to interact with the API endpoints.

## Endpoints
- **GET /health**: Returns { ok: true } if the server is running.
- **GET /openapi.json**: Returns OpenAPI 3.x specification for the API, including paths for todos.
- **GET /todos**: Lists all todos.
- **POST /todos**: Creates a new todo (body should contain `{ title }`).
- **GET /todos/:id**: Retrieves a specific todo by ID.
- **PATCH /todos/:id**: Updates a specific todo (body should contain `{ done: true }`).
- **DELETE /todos/:id**: Deletes a specific todo.

## Testing
Tests are provided in the form of oracle tests. You can run them using `node --test tests/oracle.test.js`.
