    {"path": "src/server.js", "content": "const http = require('http');
const url = require('url');
const fs = require('fs');
const path = require('path');
const { v4: uuidv4 } = require('uuid');

const server = http.createServer((req, res) => {
  const parsedUrl = url.parse(req.url, true);
  if (parsedUrl.pathname === '/todos' && req.method === 'GET') {
    // List all todos
    fs.readFile('todos.json', 'utf8', (err, data) => {
      if (err) {
        res.writeHead(500, {'Content-Type': 'application/json'});
        res.end(JSON.stringify({ok: false, message: err.message})); 
      } else {
        res.writeHead(200, {'Content-Type': 'application/json'});
        res.end(data);
      }
    });
  } else if (parsedUrl.pathname === '/todos' && req.method === 'POST') {
    // Create a new todo
    let body = '';
    req.on('data', chunk => { body += chunk.toString(); });
    req.on('end', () => {
      const parsedBody = JSON.parse(body);
      if (!parsedBody.title) {
        res.writeHead(400, {'Content-Type': 'application/json'});
        res.end(JSON.stringify({ok: false, message: 'Title is required'})); 
      } else {
        fs.readFile('todos.json', 'utf8', (err, data) => {
          if (err) {
            res.writeHead(500, {'Content-Type': 'application/json'});
            res.end(JSON.stringify({ok: false, message: err.message})); 
          } else {
            const todos = JSON.parse(data || '[]');
            const newTodo = { id: uuidv4(), title: parsedBody.title, completed: false };
            todos.push(newTodo);
            fs.writeFile('todos.json', JSON.stringify(todos), err => {
              if (err) {
                res.writeHead(500, {'Content-Type': 'application/json'});
                res.end(JSON.stringify({ok: false, message: err.message})); 
              } else {
                res.writeHead(201, {'Content-Type': 'application/json'});
                res.end(JSON.stringify({ok: true, todo: newTodo}));
              }
            });
          }
        });
      }
    });
  } else {
    // Handle other routes
    res.writeHead(404, {'Content-Type': 'application/json'});
    res.end(JSON.stringify({ok: false, message: 'Not found'}));
  }
});

server.listen(3000, () => {
  console.log('Server running at http://localhost:3000');
});
